import styled from "styled-components";

function App() {

  const Father = styled.div`
    display: flex;
  `;

  const BoxOne = styled.div`
    background-color: teal;
    width: 100px;
    height: 100px;
  `;

  const BoxTwo = styled.div`
    background-color: ${(props)=>props.bgColor};
    width: 100px;
    height: 100px;
  `;

  const Text = styled.span`
    color: white;
  `;

  return (
    <Father>
      <Box bgColor="teal"/>
      <Box bgColor="tomato"/>
    </Father>
  );
}

export default App;
